import React from "react";
//import ReactDOM from "react-dom";
import logo from "./logo.svg";
import "./App.css";
import TableParameter2 from "./tablechallenge2a.js";
import Football from "./Buttons9";
import Main from "./Main";
import ButtonChallenge1 from "./buttonchallenge1";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Football />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;

